import React from "react";
import {
  MdOutlineLocalMall,
  MdOutlineFavoriteBorder,
  MdFavoriteBorder,
  MdPermIdentity,
} from "react-icons/md";

import { Link } from "react-router-dom";
import WishlistPage from "../pages/WishlistPage";

function ProductComponent({id, image, price, category, type }) {
  //   console.log(props);
  
  function handlewishlist(id, image, price, category, type) {
    <WishlistPage id={id} image={image} price={price} category={category} type={type} />
  }

  return (
    <div className="div-productcomponent">
      <Link to={`/${category}/${type}/${id}-detailpage`}>
        <div >
          <img src={image} alt="" />
          <h4>Brand : Levi's</h4>
          <h4>Size : M</h4>
          <h4>price : {price}</h4>
        </div>
      </Link>
      <button onClick={() => handlewishlist(id, image, price, category, type)}>
        <span>
          <MdOutlineFavoriteBorder />
        </span>
        wishlist
      </button>
    </div>
  );
}

export default ProductComponent;
